                        interval = setInterval(function(){
                            checkPayStatus(charge, null,function(){
                                if(charge.data.Channel == "alipay_super_qr"){
                                    layer.iframeSrc(dialogId, successUrl);
                                }else{
                                    layer.closeAll();
                                    dialogId = layer.open({
                                        type: 2,
                                        title: title,
                                        cancel: function () {
                                            checkPayStatus(charge, extra.onCancel);
                                        },
                                        area: ['258px', '300px'],
                                        fix: false, //不固定
                                        content: successUrl
                                    });
                                }
                                clearInterval(interval);
                            });
                        }, 4000);
