        function isIphoneX(){
            //return /iphone/gi.test(navigator.userAgent) && (screen.height == 812 && screen.width == 375);
            return /iphone/gi.test(navigator.userAgent);
        }

        function checkPayStatus(charge, cancelCallback,successCallback) {
            var url = "";
            if(charge.data.Channel == "paypal_web"){
                //paypal_web为海外渠道，要使用海外地址
                url = "https://zhifu-us.99.com/sdp/paysdk/Api/comServer.ashx";
            }else{
                url = "https://zhifu.99.com/sdp/paysdk/Api/comServer.ashx";
            }

            var data = {
                "ActionID": 1006,
                "OrderNo": charge.data.OrderNo,
                "Sign": charge.data.Sign
            };
            get(url, data, true, function (response) {
                var result = {
                    code: 0,
                    status: "",
                    message:""
                };
                if (response.Code == 0) {
                    var message = JSON.parse(response.Mes);
                    if (message.length == 1) {
                        var status = message[0].TradeStatus;
                        if (status == "WAIT_BUYER_PAY") {
                            //等待用户付款
                            result.code = 2;
                            result.status = status;
                            result.message = "等待用户付款";
                        } else if (status == "TRADE_SUCCESS") {
                            //交易成功
                            result.code = 1;
                            result.status = status;
                            result.message = "交易成功";
                            if(successCallback != null)
                                successCallback(result);
                        } else {
                            //交易失败
                            result.code = 3;
                            result.status = status;
                            result.message = "交易失败";
                        }
                    } else {
                        result.code = 4;
                        result.status = "";
                        result.message = "查询接口响应异常";
                    }
                } else {
                    result.code = 5;
                    result.status = "";
                    result.message = "网络异常或服务端超时";
                }
                if(cancelCallback != null)
                    cancelCallback(result);
            }, null);
        }

        function checkCharge(charge) {
            var result = {};
            if (charge == null) {
                result.state = false;
                result.message = "凭证不正确";
                result.code = "102";
                return result;
            }
            if (charge.errorCode == null ||
                charge.msg == null ||
                charge.data == null) {
                result.state = false;
                result.message = "凭证不正确";
                result.code = "102";
                return result;
            }
            if (charge.errorCode != "0" || charge.msg != "ok") {
                result.state = false;
                result.message = "获取支付凭证失败";
                result.code = "103";
                return result;
            }
            if (charge.data.Channel != "paypal_web" &&
                charge.data.Channel != "alipay_wap" &&
                charge.data.Channel != "alipay_wapv2" &&
                charge.data.Channel != "wx_pub" &&
                charge.data.Channel != "alipay_super_qr" &&
                charge.data.Channel != "wx_pub_qr") {
                result.state = false;
                result.message = "未开通的支付渠道";
                result.code = "104";
                return result;
            } else {
                if (charge.data.PayParams == null) {
                    result.state = false;
                    result.message = "支付凭证的支付参数不正确";
                    result.code = "105";
                    return result;
                }
            }
            result.state = true;
            return result;
        }

        //获取支付标题
        function getPayTitle(charge) {
            var title = "";
            if (charge.data.Channel == "paypal_web") {
                title = "PayPal支付";
            } else if (charge.data.Channel == "alipay_wap" || charge.data.Channel == "alipay_wapv2") {
                title = "支付宝支付";
            } else if (charge.data.Channel == "alipay_super_qr") {
                title = "支付宝扫码支付";
            } else if (charge.data.Channel == "wx_pub_qr") {
                title = "微信扫码支付";
            }
            return title;
        }

        function doWXPubPay(charge, extra) {
            var payParams = parseQueryString(charge.data.PayParams);
            function onBridgeReady() {
                WeixinJSBridge.invoke(
                    'getBrandWCPayRequest', {
                        "appId": payParams.appId,
                        "timeStamp": payParams.timeStamp,
                        "nonceStr": payParams.nonceStr,
                        "package": payParams.package,
                        "signType": payParams.signType,
                        "paySign": payParams.paySign
                    },
                    function (res) {
                        if (res.err_msg == "get_brand_wcpay_request:ok") {
                            if (extra != null) {
                                if (extra.wx_url_success != null)
                                    window.location.href = extra.wx_url_success;
                            }
                        } else {
                            if (extra != null) {
                                if (extra.wx_url_fail != null)
                                    window.location.href = extra.wx_url_fail;
                                else
                                    alert("支付失败");
                            } else
                                alert("支付失败");
                        }
                        setTimeout(function () {
                            frecuncyCtrl = true;
                        }, 1500);
                    }
                );
            }
            if (typeof WeixinJSBridge == "undefined") {
                if (document.addEventListener) {
                    document.addEventListener('WeixinJSBridgeReady', onBridgeReady, false);
                } else if (document.attachEvent) {
                    document.attachEvent('WeixinJSBridgeReady', onBridgeReady);
                    document.attachEvent('onWeixinJSBridgeReady', onBridgeReady);
                }
            } else {
                onBridgeReady();
            }
        }

